import React from 'react';
import styled from "styled-components";

import './index.css';

const title     = "The Coastline Paradox"
const hook      = "Is it possible to measure a coastline’s true length?"

const Box = styled.div`
    font-weight: bold;
    margin: 5em;
    padding: 10em ;
    border: 1px solid;
`;


function Header() {
  return (
    <Screen>
        <h1>{title}</h1>
        <h2>{hook}</h2>
    </Screen>
  );
}

export default Header;
